import React from "react";
import { connect } from "react-redux";
import { selectMenu } from "../../redux/menu/menu-selector.js";
import SubNav from "../navbar-component/submenu.component";
import CartIcon from '../cart-icon-component/cart-icon-component'
import CartDropdown from '../cart-dropdown-component/cart-dropdown-component'
import Header from '../header/header.component'
import "./submenu.styles.css";

const Menu = ({ navbar }) => {
  console.log(navbar);
  return (
    <div className="header-container">
      <Header/>
      <div className='logo-cart'>
      <div className="title">
        <img src="https://images.ctfassets.net/5de70he6op10/53ZOE4rRqrxcvv0hg2eSLV/daaeb583c81d0acf5b5c3496366d6988/anthro-logo.svg" />
      </div>
      <div className='cart'>
      <div>
        <CartIcon />
        {true ? (
          <div></div>
        ) : (
          <div>
            <CartDropdown />
          </div>
        )}
      </div>
      </div>
      </div>
      

      <div className="navigation-container">
        {navbar.map((items) => (
          <SubNav {...items} />
        ))}
      </div>
    </div>
  );
};

const mapStateToProps = (state) => ({
  navbar: selectMenu(state),
});

export default connect(mapStateToProps)(Menu);
